import React from "react";
import CarouselComponentMovieNow from "./(utils)/CarouselMovieNow";

const TrendingMovieNow = () => {
  return (
    <div className="flex flex-col gap-5 pl-10 pt-10 border-2">
      <div className="text-xl font-bold flex flex-row gap-10 items-center">
        <div className="rounded bg-yellow-400 p-1">Trending Today</div>
      </div>
      <div className="border-2">
        <CarouselComponentMovieNow />
      </div>
    </div>
  );
};

export default TrendingMovieNow;
